angular.module('templates', []).run(['$templateCache', function($templateCache) {$templateCache.put('modules/todoList/todo-list.html','<div class="box">\n  <!-- <pre>\n    {{listItems|json}}\n  </pre> -->\n  <div class="box" id="heading">\n    {{items.name}}\n  </div>\n  <ul ng-repeat="item in items.items">\n    <span>\n      <p ng-class="{completed: item.completed}">\n        <input type="checkbox" ng-model="item.completed" ng-click="toggleComplete(item)">\n        {{item.item_text}}\n        <span ng-if="item.completed">Completed</span>\n      </p>\n    </span>\n  </ul>\n\n  <form class="item" ng-submit="addItem()">\n    <input type="text" name="newItem" ng-model="newItem" placeholder="New Item" autocomplete="off">\n    <input class="btn1" type="submit" name="list" id="submit" value="+" />\n  </form>\n\n\n  <form ng-submit="delete()">\n    <button class="btn2" type="submit">Clear Marked</button>\n  </form>\n</div>\n');}]);